import './App.css';

function App() {
  return (
    <div className="App">
                  <TopBar userAuth={userAuth} />
            <ScrollableComponent
                styles={{
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    justifyContent: "center",
                    flexGrow: 1,
                }}
            >
                <Stack spacing={2}>
                    <UserBadge username="Ignacio Romang" isActive={false} />
                    <RenewalCard />
                    <RegisterCard />
                    <LoginCard />
                    <InfoCard />
                </Stack>
                <Footer></Footer>
            </ScrollableComponent>
    </div>
  );
}

export default App;
